// src/components/HomePage.js
import React from 'react';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the File Tool App</h1>
            <p>This is a simple tool to demonstrate file upload, download, and retrieval.</p>
            <a href="/tool">Go to Tool</a>
        </div>
    );
}

export default HomePage;
